<?php
// Matt's CPPS Register
#error_reporting(0);

require_once("guid.php");
session_start();
$msg = "";
$color = $_POST['color'];
$name = $_POST['name'];
$pass = $_POST['pass'];
$swid = guid();
$hashedPass = strtoupper(md5($_POST['pass']));
$email = $_POST['email'];
$email2 = filter_var($email, FILTER_SANITIZE_EMAIL);
$ip = $_SERVER["HTTP_CF_CONNECTING_IP"];
$date = time();
if(isset($_POST['captcha'])) {
$captcha = $_POST['captcha'];
$ans = $_SESSION["ans"];
}
$ref = $_SESSION["ref"];
if($color >= 1 && $color <= 16) {
	if(ctype_alnum($name) && strlen($name) >= 4 && strlen($name) <= 12) {
		if(strlen($pass) >= 6 && strlen($pass) <= 32) {
			if(filter_var($email2, FILTER_VALIDATE_EMAIL)) {
				if(isset($captcha) && $captcha == $ans) {
					try {
						$nameTaken = $db->prepare("SELECT uname FROM `users` WHERE uname = :name");
						$nameTaken->bindParam(':name', $name);
						$nameTaken->execute();
						$numrowsName = $nameTaken->rowCount();
					} catch (Exception $e) {
						die("Database error - this is our fault. Please try again later. Error: nameTaken");
					}
					if ($numrowsName == 0) {
						if(isset($_SESSION["ref"])) {
							try {
								$ipTaken = $db->prepare("SELECT * FROM users WHERE IP = :ip");
								$ipTaken->bindParam(':ip', $ip);
								$ipTaken->execute();
								$numrowsIp = $ipTaken->rowCount();
							} catch (Exception $e) {
								die("Database error - this is our fault. Please try again later. Error: ipTaken");
							}
							if ($numrowsIp == 0) {
							try {
								$updatePoints = $db->prepare("UPDATE users SET credits = credits + 100 WHERE uname = :ref");
								$updatePoints->bindParam(':ref', $ref);
								$updatePoints->execute();
							} catch (Exception $e) {
								die("Database error - this is our fault. Please try again later. Error: updatePoints");
							}
							} else {
							// User already used referral link
							}
						} else {
							// User was not referred
						}
						try {
							$insertPenguin = $db->prepare("INSERT INTO `users` (`ID`, `uname`, `nname`, `pword`, `SWID`, `Email`, `IP`, `RegistrationDate`, `Inventory`, `Color`, `Igloos`, `Floors`, `Locations`) VALUES (NULL, :name, :name, :hashedPass, :swid, :email2, :ip, :date, :color, :color, '1|0', '0|0', '1|0');");
							$insertPenguin->bindParam(':name', $name);
							$insertPenguin->bindParam(':hashedPass', $hashedPass);
							$insertPenguin->bindParam(':swid', $swid);
							$insertPenguin->bindParam(':email2', $email2);
							$insertPenguin->bindParam(':ip', $ip);
							$insertPenguin->bindParam(':date', $date);
							$insertPenguin->bindParam(':color', $color);
							$insertPenguin->execute();
						} catch (Exception $e) {
							die("Database error - this is our fault. Please try again later. Error: insertPenguin");
						}
						try {
							$penguinId = $db->lastInsertId();
							$insertIgloo = $db->prepare("INSERT INTO `igloos` (`ID`, `Owner`, `Likes`) VALUES (NULL, {$penguinId}, '[]');");
							$insertIgloo->execute();
						} catch (Exception $e) {
							die("Database error - this is our fault. Please try again later. Error: insertIgloo");
						}
						try {
							$iglooId = $db->lastInsertId();
							$setIgloo = $db->prepare("UPDATE `users` SET `Igloo` = {$iglooId} WHERE ID = {$penguinId}");
							$setIgloo->execute();
						} catch (Exception $e) {
							die("Database error - this is our fault. Please try again later. Error: setIgloo");
						}
						$msg = "<script>function go(){window.location=\"http://mattscpps.us/play/client/?lang=en\";}setTimeout('go()','2000');</script><center><font color=white>Thanks for registering!</font></center><br />";
					} else {
						$msg = "<center><font color='cd5555' style='font-size: 32px;font-family: proximanova;'>uname already taken.</font></center><br />";
					}
				} else {
					$msg = "<center><font color='cd5555' style='font-size: 32px;font-family: proximanova;'>Invalid captcha.</font></center><br />";	
				}
			} else {
				$msg = "<center><font color='cd5555' style='font-size: 32px;font-family: proximanova;'>Invalid email.</font></center><br />";
			}
		} else {
			$msg = "<center><font color='cd5555' style='font-size: 32px;font-family: proximanova;'>Your password does not meet the criteria.<br>You can enter 6-32 letters, numbers, or symbols.</font></center><br />";
		} 
	} else {
		$msg = "<center><font color='cd5555' style='font-size: 32px;font-family: proximanova;'>Your username does not meet the criteria.<br>You can enter 4-12 LETTERS and/or NUMBERS. No spaces.</font></center><br />";
} 
} else { 
	$msg = "<center><font color='cd5555' style='font-size: 32px;font-family: proximanova;'>There was an error</font></center><br />";
	}
session_destroy();
?>
